function onEditSettingComplete(n){if(response=JSON.parse(n.responseText),response.IsSuccessfull==!0){var t=$("#setting");t.removeClass("toggled");t.find("#BirthDateText_View").html(t.find(".pmbb-edit #BirthDateText").val());t.find("#FilesPersistance_View").html(t.find(".pmbb-edit #FilesPersistance").val());return}}